import React, { useState } from "react";
import { Container } from 'react-bootstrap';
import { Row } from 'react-bootstrap';
import { Col } from 'react-bootstrap';

const AboutUs = () => {
    return (
        <section id="ueber" className="ueberSection">
            <Container>
                <Row>
                    <Col>
                    <img src="././img/Ligaspiel.jpg" className="img-fluid"></img>
                    </Col>
                    <Col>
                    <h2>Wir stellen uns vor</h2>
                    <p>Die Dartsfreunde Geisling Pfatter e.V. (DFGP) sind ein eingetragener gemeinnütziger Dartsportverein mit der Spiel- und Trainingsstätte im „Gasthaus Posthorn“.
                         Als ein paar enthusiastische Dartspieler von  Geisling und Pfatter die Idee hatten, sich am Dartboard mit anderen Dartern in einer Liga zu messen, entstand die Vision einen Verein zu gründen.
                          Die Gründung des Vereins im Oktober 2021 war dann nur logische Konsequenz.
                         Seit der Saison 2021/20222 nehmen wir am Ligabetrieb des Mittel- und Ober¬fränkischen Dart¬verbandes teil</p>
                    </Col>
                </Row>
            </Container>
        </section>
    )
}


export default AboutUs;
